"use client";
import { jsPDF } from "jspdf";
import "jspdf-autotable";

import { useEffect, useState } from "react";

export default function renderPDF({ shop, year, month, encryption, password }) {
  const [loading, setLoading] = useState(false);
  const company = {
    name: "Pricee.com.bd",
    logo: "data:image/png;base64,",
  };
  const generate = async () => {
    setLoading(true);
    const res = await fetch(
      `${process.env.NEXT_PUBLIC_API_MANAGE_URL}/report/generate?shopId=${shop.id}&month=${month.id}&year=${year.id}`,
      {
        method: "GET",
        headers: {
          "Content-Type": "application/json",
        },
        next: {
          cache: "no-store",
        },
      }
    );
    const data = await res.json();

    const date = new Date();
    let enc = {};
    if (encryption) {
      enc = {
        encryption: {
          userPassword: password,
          ownerPassword: password,
          userPermissions: ["print", "modify", "copy", "annot-forms"],
        },
      };
    }
    const doc = new jsPDF(enc);
    doc.getFontList();
    const myFont =
      "https://fonts.googleapis.com/css2?family=Poppins:wght@500&display=swap";
    doc.addFileToVFS("Poppins-Regular.ttf", myFont);
    doc.addFont("Poppins-Regular.ttf", "Poppins", "regular");

    doc.setFont("arial", "bold");

    // Add the company name and address
    doc.addImage(company.logo, "PNG", 10, 10, 30, 7.5);

    doc.setFontSize(10);
    doc.text("Shop : " + shop.name, 10, 25);
    doc.text(
      "Generated on : " +
        date.toLocaleDateString("en-UK", {
          year: "numeric",
          month: "short",
          day: "numeric",
        }),
      10,
      30
    );
    doc.text("Report For : " + month.name + " " + year.name, 10, 35);

    // Add the most clicked links
    doc.setFontSize(14);
    doc.text("Most Clicked Links", 20, 50);
    const externalLinkClickData = data.mostClickedLinks.map((item) => [
      item.id,
      item.href,
      item.click_count,
    ]);
    doc.autoTable({
      startY: 60,
      head: [["id", "link", "Click count"]],
      body: externalLinkClickData,
    });

    // Add the most visited products
    doc.setFontSize(14);
    doc.text("Most Visited Products", 20, doc.autoTable.previous.finalY + 20);
    const productsTableData = data.mostVisitedProducts.map((item) => [
      item.id,
      item.name,
      item.view_count,
    ]);
    doc.autoTable({
      startY: doc.autoTable.previous.finalY + 30,
      head: [["id", "Product Name", "Views"]],
      body: productsTableData,
    });

    //get current timestamp
    doc.save(
      shop.name + " " + month.name + " " + year.name + " Report [Pricee].pdf"
    );
    setTimeout(() => {
      setLoading(false);
    }, 1000);
  };
  return (
    <button
      className="mt-4 w-full rounded-lg bg-accent-1 py-2 text-sm font-medium text-white hover:bg-accent-2"
      onClick={() => generate()}
    >
      {loading && <i className="fa-solid fa-spinner-third fa-spin mr-2"></i>}
      Generate
    </button>
  );
}
